const data = [
  { product: 'Pão', quantity: 25, price: 1.99 },
  { product: 'Livro', quantity: 13, price: 10.99 },
  { product: 'tenis', quantity: 2, price: 42.99 },
  { product: 'carro', quantity: 5, price: 20300.99 },
  { product: 'luva', quantity: 800, price: 8.75 },
];

export default data;
